    numberOfReviews: "120",
    coursesTaught: ["CSE115", "CSE116", "CSE331"],
    reviews: [
        {
            author: "bot",
            content: "Dr. Smith is an exceptional professor who makes complex topics easily understandable.",
            rating: 4,
            course: "CSE115",
            term: "FALL2023"
        },
        {
            author: "apple",
            content: "The course was well-structured, but I found office hours to be more helpful than lectures.",
            rating: 5,
            course: "CSE115",
            term: "SPRING2024"
        }
